events:
  break64Logs: "objective start break64Logs"
  break64Logs_started: 'tag add break64Logs_started'
  break64Logs_done: 'tag add break64Logs_done'
  break64Logs_paid: 'tag add break64Logs_paid'

  entry_break64Logs_started: 'journal add break64Logs_started'
  entry_break64Logs_done: 'journal add break64Logs_done'
  entry_break64Logs_paid: 'journal add break64Logs_paid'

  break128Logs: "objective start break128Logs"
  break128Logs_started: 'tag add break128Logs_started'
  break128Logs_done: 'tag add break128Logs_done'
  break128Logs_paid: 'tag add break128Logs_paid'
  
  entry_break128Logs_started: 'journal add break128Logs_started'
  entry_break128Logs_done: 'journal add break128Logs_done'
  entry_break128Logs_paid: 'journal add break128Logs_paid'


  break192Logs: "objective start break192Logs"
  break192Logs_started: 'tag add break192Logs_started'
  break192Logs_done: 'tag add break192Logs_done'
  break192Logs_paid: 'tag add break192Logs_paid'
  
  entry_break192Logs_started: 'journal add break192Logs_started'
  entry_break192Logs_done: 'journal add break192Logs_done'
  entry_break192Logs_paid: 'journal add break192Logs_paid'


  break256Logs: "objective start break256Logs"
  break256Logs_started: 'tag add break256Logs_started'
  break256Logs_done: 'tag add break256Logs_done'
  break256Logs_paid: 'tag add break256Logs_paid'
  
  entry_break256Logs_started: 'journal add break256Logs_started'
