  break64Logs_reset: 'tag del break64Logs_started,break64Logs_done,break64Logs_paid'
  break128Logs_reset: 'tag del break128Logs_started,break128Logs_done,break128Logs_paid'
  break192Logs_reset: 'tag del break192Logs_started,break192Logs_done,break192Logs_paid'
  break256Logs_reset: 'tag del break256Logs_started,break256Logs_done,break256Logs_paid'
  
  timber_reset: 'folder break64Logs_reset,break128Logs_reset,break192Logs_reset,break256Logs_reset'

